class BLMDonate extends Component {
  /**
   * Render the BLMDonate component
   * @returns {ReactElement}
   */
  render() {
    return (
      <div className="page-container">
        <Typography variant="h6">
          Donate:
        </Typography>
      </div>
    );
  }
}

export default BLMDonate;
